              nhtListUser.map((user) => (
                <tr key={user.id}>
                  <td>{user.id}</td>
                  <td>{user.nht_name}</td>
                  <td>{user.nht_email}</td>
                  <td>{user.nht_phone}</td>
                  <td>
                    {user.nht_active ? (
                      <span className="badge bg-success">Ho·∫°t ƒë·ªông</span>
